How to group by counted elements using aggregation in MongoDB?<p>I have to write some aggregation using MQL. The case is:</p>
<ol>
<li>There is a chat application</li>
<li>Collection contains info about: thread, sent message, sent time, read time</li>
</ol>
<p>Sample records are shown below.</p>
<hr />
<p><strong>message_collection</strong></p>
<pre><code>[
    {
      &quot;thread&quot; : &quot;war conference&quot;,
      &quot;message&quot; : &quot;stop&quot;,
      &quot;sentInMilli&quot;: 1696858510000, // oldest message in war conference
      &quot;statuses&quot;: [ {&quot;readInMilli&quot;: 1696858547857} ]
    },
    {
      &quot;thread&quot; : &quot;economic conference&quot;,
      &quot;message&quot; : &quot;welcome on economic conference&quot;,
      &quot;sentInMilli&quot;: 1696858520000, // newest message in economic conference
      &quot;statuses&quot;: [ {&quot;readInMilli&quot;: 1696858547857} ]
    },
    {
      &quot;thread&quot; : &quot;war conference&quot;,
      &quot;message&quot; : &quot;the war&quot;,
      &quot;sentInMilli&quot;: 1696858530000, // newest message in war conference
      &quot;statuses&quot;: [ ]
    }
]
</code></pre>
<hr />
<p>What I want to do is to display data about threads. To be more specific I need to know which thread have unread messages. As you can see in the example above, there are 2 threads: <code>war conference</code> and <code>economic conference</code>.</p>
<p>So after my supposable aggregation I want to get that kind of records:</p>
<pre><code>[
  {
    &quot;thread&quot;: &quot;war conference&quot;,
    &quot;timeInMilliOfNewestMessage&quot;: 1696858530000,
    &quot;containsUnreadMessages&quot;: true
  },
  {
    &quot;thread&quot;: &quot;economic conference&quot;,
    &quot;timeInMilliOfNewestMessage&quot;: 1696858520000,
    &quot;containsUnreadMessages&quot;: false
  }
]
</code></pre>
<hr />
<p>My current pseudo-query:</p>
<pre><code>db.getCollection('message_collection').aggregate(
    [
        {
            &quot;$match&quot;: { } // my other conditions...
        },
        {
            &quot;$group&quot;: {
                &quot;_id&quot;: &quot;thread&quot;, 
                &quot;timeInMilliOfNewestMessage&quot;: {&quot;$max&quot;: &quot;$sentInMilli&quot;},
                &quot;containsUnreadMessages&quot;: { 
                    &quot;$count&quot;: {
                        &quot;statuses&quot;: {
                            &quot;$elemMatch&quot;: {
                                &quot;readInMilli&quot;: { &quot;$exists&quot;: false }
                            } 
                        }
                    }
                }
            }
        }
    ]
)
</code></pre>
<p>As you can see, I have an idea to firstly count all messages that are already read. Then I would like to convert it to boolean ones.</p>
<p>I got this error:</p>
<pre><code>Unrecognized expression '$elemMatch'
</code></pre>
<hr />
<p>I know this syntax is invalid but I don't know why :/<br />
Maybe what I want to achieve is impossible in the group section?<br />
Could someone help me with that?</p>
<pre><code>db.version()
4.0.0
</code></pre>

