How to read which host of a MongoDB cluster answered my query (in Rust)?<p>I use MongoDB in a Rust application. I would like to know which server in the cluster send the response of a query.</p>
<p>I can see the information (<code>serverHost=</code>) when I <a href="https://mongodb.github.io/mongo-rust-driver/manual/tracing.html#consuming-events-with-tracing" rel="nofollow noreferrer">consume events</a> with <code>tracing</code> crate but I would like to use it in my application and don't know how to access it.</p>
<p>I think, what I need is <a href="https://docs.rs/mongodb/2.7.0/mongodb/struct.ServerInfo.html#method.address" rel="nofollow noreferrer">ServerInfo.address</a> but it is not accessible from my Client instance.</p>
<p><strong>EDIT</strong>: The code below is the minimum of what I am trying to do. How can the hostname of the responding server be assigned to <code>address</code> variable?</p>
<pre><code>use mongodb::{bson::doc, options::{ClientOptions, ServerApi, ServerApiVersion}, Client};

#[tokio::main]
async fn main() -&gt; mongodb::error::Result&lt;()&gt; {
    // Replace the placeholder with your MongoDB connection string
    let uri = &quot;&lt;connection string&gt;&quot;;
    let mut client_options = ClientOptions::parse(uri).await?;
    let client = Client::with_options(client_options)?;

    // Send a ping to confirm a successful connection
    client
        .database(&quot;admin&quot;)
        .run_command(doc! {&quot;ping&quot;: 1}, None)
        .await?;

    // Somehow get hostname of responding server
    // let address = ...? 

    println!(&quot;Got ping from {}&quot;, address);

    Ok(())
}
</code></pre>

