how to get mongodb to use a compound index where one of the fields is not involved?<p>compound index:</p>
<pre><code>{
  A: 1,
  B: 1,
  C: 1
}
</code></pre>
<p>query:</p>
<pre><code>col.aggregate([
  {
    $match: {
     B: &quot;ssome_value&quot;,
     C: &quot;some_other_value,
    }
  }
])
</code></pre>
<p>The query does not involve <code>A</code>, so the compound index is not used. I can do this to trick it to use the index:</p>
<pre><code>col.aggregate([
  {
    $match: {
     A: { $exists: true },
     B: &quot;ssome_value&quot;,
     C: &quot;some_other_value,
    }
  }
])
</code></pre>
<p>But the problem is that the results would be inaccurate. It should return all documents regardless of <code>A</code>, not just that it exists. Whether or not <code>A</code> exists, it should still be returned.</p>

